import "./Page3pop.css";

const form = document.getElementById("form");

window.onclick = function (e) {
  if (e.target.nodeName === "BODY" && e.target.classList.contains("modal")) {
    closeForm();
  }
};

function openForm() {
  document.body.classList.add("modal");

  form.style.display = "block";

  setTimeout(() => {
    form.classList.add("form_active");
  }, 200);
}

function closeForm() {
  document.body.classList.remove("modal");
  form.style.display = "none";
  form.classList.remove("form_active");
}

function Page3pop() {
  return (
    <div className="Page3pop">
      <div className="Page3pop-bg">
        <div className="Page3pop-content">
          <img src="/images/pop1.png" />
          <input />
        </div>
      </div>
    </div>
  );
}

export default Page3pop;
